import axios from "axios";
import { TEST_ACTION_SAGA } from "../Redux/Types";

const URL = `https://jsonplaceholder.typicode.com/posts`;

export default class Api {
  static fetchData = async () => await axios.get(`${URL}`);
  static fetchSingleData = async () => await TEST_ACTION_SAGA.get(`${URL}`);
}
